import './itemcard.css';

const item = (param) => {
    return(
        <>
            <div id="card">
                <img src = {param.src} id="profile_photo"></img>
                
                <h1 id="title">{param.title}</h1>
                <h3 id="desc">{param.desc}</h3>
                
            </div>
        </>
    )
};

export default item
